import React, { useState, useEffect } from "react";

export default function AdminPreferences() {
  const [recommendedPOIs, setRecommendedPOIs] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const user = JSON.parse(localStorage.getItem("user"));
    const token = user?.token;

    if (!user) {
      setLoading(false);
      return;
    }

    // Fetch ML recommendations from your backend
    fetch("http://localhost:5000/api/recommend", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Authorization: `Bearer ${token}`,
      },
      body: JSON.stringify({
        user_id: user.id,
        preferred_tags: [], // Optional: pass an array of preferred tags
      }),
    })
      .then((res) => res.json())
      .then((data) => {
        setRecommendedPOIs(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error("Error fetching recommendations:", err);
        setLoading(false);
      });
  }, []);

  return (
    <div
      style={{
        marginLeft: 220,
        padding: 30,
        fontFamily: "'Poppins', sans-serif",
        background: "linear-gradient(180deg, #f4faf4 0%, #ffffff 100%)",
        minHeight: "100vh",
        color: "#2f3e2f",
        transition: "all 0.3s ease",
      }}
    >
      <h2
        style={{
          fontSize: "2rem",
          color: "#2b593f",
          marginBottom: "25px",
          textShadow: "1px 1px 2px rgba(43, 89, 63, 0.2)",
          fontWeight: 700,
        }}
      >
        Recommended POIs
      </h2>

      {loading ? (
        <p style={{ color: "#6b8061", fontStyle: "italic", fontSize: "1.1rem" }}>
          Loading...
        </p>
      ) : recommendedPOIs.length === 0 ? (
        <p style={{ color: "#6b8061", fontStyle: "italic", fontSize: "1.1rem" }}>
          No recommendations found.
        </p>
      ) : (
        <div
          style={{
            backgroundColor: "#ffffff",
            borderRadius: "16px",
            boxShadow: "0 6px 20px rgba(50, 100, 70, 0.1)",
            width: "80%",
            overflow: "hidden",
            transition: "transform 0.3s ease",
          }}
        >
          <table
            style={{
              width: "100%",
              borderCollapse: "collapse",
              borderRadius: "12px",
              overflow: "hidden",
              fontSize: "1.1rem",
            }}
          >
            <thead>
              <tr style={{ backgroundColor: "#7ebc85", color: "#fff" }}>
                <th style={{ border: "none", padding: "16px", textAlign: "left" }}>Rank</th>
                <th style={{ border: "none", padding: "16px", textAlign: "left" }}>POI Name</th>
                <th style={{ border: "none", padding: "16px", textAlign: "left" }}>Tags</th>
                <th style={{ border: "none", padding: "16px", textAlign: "left" }}>Score</th>
              </tr>
            </thead>
            <tbody>
              {recommendedPOIs.map((poi, index) => (
                <tr
                  key={poi.id}
                  style={{
                    backgroundColor: index % 2 === 0 ? "#f3f8f3" : "#ffffff",
                    transition: "background-color 0.3s ease",
                  }}
                  onMouseEnter={(e) => (e.currentTarget.style.backgroundColor = "#e8f3e8")}
                  onMouseLeave={(e) =>
                    (e.currentTarget.style.backgroundColor = index % 2 === 0 ? "#f3f8f3" : "#ffffff")
                  }
                >
                  <td style={{ borderBottom: "1px solid #d9e4d6", padding: "14px 16px" }}>{index + 1}</td>
                  <td style={{ borderBottom: "1px solid #d9e4d6", padding: "14px 16px" }}>{poi.name}</td>
                  <td style={{ borderBottom: "1px solid #d9e4d6", padding: "14px 16px" }}>{poi.tags}</td>
                  <td style={{ borderBottom: "1px solid #d9e4d6", padding: "14px 16px" }}>{poi.score?.toFixed(2)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
